import './App.css';
import {BrowserRouter, Routes, Route } from "react-router-dom";
import NavBar from "./components/NavBar";
import Home from "./pages/Home";
import NewContact from "./pages/NewContact"

const AddressBook = require('./components/AddressBook') 

function App() {
    // an object of the AddressBook is created and is passed by reference to all the other components.
    const book = new AddressBook();

    return (
        // the broswer router allows us navigate between different page components
        <BrowserRouter>
            // the nav bar 
            <NavBar />
                <Routes>
                    <Route path="/" element={<Home addressBook={book} />} />
                    <Route path="/new_contact" element={<NewContact addressBook={book} />} />
                </Routes>
        </BrowserRouter>
    );
}

export default App;
